/**
 * 作者：Mr.wang
 * 时间：2022/4/12
 * 文件名：index
 * 项目名称：脚手架
 * WebStorm
 */
import React, {Component} from "react";
import item from "./index.module.css"
export default class Item extends Component {
    render() {
        const {itema} = this.props;
        return (
            <div className={item.item}>
                <div>
                    <img src = {itema.avatar_url} alt = ''/>
                </div>
            </div>
        );
    }
}
